import React from "react";
import { signOut } from "firebase/auth";
import { auth } from "./firebase";
import { Link, Outlet } from "react-router-dom";
import CSVUploader from "./CSVUploader";
import ImportHistory from "./ImportHistory";

const Dashboard = ({ user }) => {
  const handleSignOut = async () => {
    await signOut(auth);
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white flex">
      <aside className="w-64 bg-gray-800 p-6 space-y-6">
        <h2 className="text-xl font-bold">Dispersion Circles</h2>
        <p className="text-gray-400">{user.displayName || user.email}</p>
        <nav className="space-y-4">
          <Link to="/dashboard" className="block hover:text-green-400">üè† Upload</Link>
          <Link to="/dashboard#history" className="block hover:text-green-400">üìú History</Link>
        </nav>
        <button onClick={handleSignOut} className="mt-auto bg-red-600 px-4 py-2 rounded hover:bg-red-700">Sign Out</button>
      </aside>

      <main className="flex-1 p-8 space-y-8 overflow-auto">
        <CSVUploader user={user} elevation={null} />
        <ImportHistory user={user} />
      </main>
    </div>
  );
};

export default Dashboard;
